### Describe the Bug

The `proxy` config in `astro.config.mjs` is **not triggering** for `/mock/api` requests:  
- No logs in terminal (`console.log`, `proxyReq`, or `proxyRes`).  
- Requests to `/mock/api` **do not rewrite** or forward to `http://localhost:4010`.  
- Mock server works when accessed directly (`curl http://localhost:4010`).  

#### **Relevant Config**  
```javascript
