import react from "@astrojs/react";
import tailwind from "@astrojs/tailwind";

// @ts-ignore
import astroI18next from "astro-i18next";
import icon from "astro-icon";
import { defineConfig } from "astro/config";
import auth from "auth-astro";

export default defineConfig({
  site: "https://parixan.xyz,
  prefetch: true,
  output: "server",
  devToolbar: {
    enabled: true
  },
  integrations: [
    icon(),
    react({
      experimentalReactChildren: true
    }),
    tailwind({
      applyBaseStyles: false,
      nesting: true
    }),
    astroI18next(),
    auth()
  ],
  server: {
    host: "127.0.0.1",
    port: 4321
  },
  adapter: node({ mode: "standalone" }),
  vite: {
    build: {
      chunkSizeWarningLimit: 1000,
      rollupOptions: {
        output: {
          manualChunks: {
            "react-vendor": ["react", "react-dom"],
            "form-vendor": ["react-hook-form", "@hookform/resolvers"],
            "ui-vendor": ["@radix-ui/react-select", "@radix-ui/react-toast", "@radix-ui/react-dialog"],
            "icons-vendor": ["lucide-react", "react-icons"]
          }
        }
      }
    },
    server: {
      host: "127.0.0.1",
      cors: true,
      allowedHosts: ["marwadi.tailb91f8d.ts.net", "localhost"],
      proxy: {
        "/staging/api": {
          target: "https://marwadi.tailb91f8d.ts.net/staging",
          changeOrigin: true,
          secure: true,
          configure: (proxy) => {
            proxy.on("error", (err, req, res) => {
              console.log("Proxy Error", err);
            });
            proxy.on("proxyReq", (proxyReq, req, res) => {
              console.log("Sending Request to the Target:", req.method, req.url);
              console.log("Proxied URL:", proxyReq.path);
            });
            proxy.on("proxyRes", (proxyRes, req, res) => {
              console.log("Received Response from the Target:", proxyRes.statusCode);
            });
          }
        },
        "/mock/api": {
          target: "http://localhost:4010",
          changeOrigin: true,
          secure: false, // For HTTP mock servers
          logLevel: "debug",
          rewrite: (path) => {
            console.log("Before rewrite:", path);
            const rewritten = path.replace(/^\/mock\/api/, "");
            console.log("After rewrite:", rewritten);
            return rewritten;
          },
          configure: (proxy) => {
            proxy.on("error", (err, req, res) => {
              console.log("Proxy Error", err);
            });
            proxy.on("proxyReq", (proxyReq, req, res) => {
              console.log("Sending Request to the Target:", req.method, req.url);
              console.log("Proxied URL:", proxyReq.path);
            });
            proxy.on("proxyRes", (proxyRes, req, res) => {
              console.log("Received Response from the Target:", proxyRes.statusCode);
            });
          }
        }
      }
    }
  }
});

```

but when we reach to page and it call the api and give 404 error; attached screenshot which show the API call and mock server data and curl result 

