#### **Steps Tried**  
1. Restarted dev server (`astro dev`).  
2. Verified mock server is running (`curl http://localhost:4010` works).  
3. Simplified config (removed `allowedHosts`, `cors`).  
4. Tested with exact request path (`fetch("/mock/api/products")`).  



#### **Questions**  
1. Is there a **minimum Astro version** for proxy support?  
2. Are there **known conflicts** with other integrations (e.g., `@astrojs/node`)?  
3. How to **debug why the proxy middleware isn‚Äôt loading**?  



### What's the expected result?

1. Terminal logs rewrite/proxy activity.  
2. `GET /mock/api/products` ‚Üí Proxied to `http://localhost:4010/products`.  

